import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "./style/swiperActual.css";
import { Navigation } from "swiper";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";

import iP14ProMax1TBSilver from "../../image/products/iPhone14ProMax1TBSilver.png";
import ip13256GBGreen from "../../image/products/iPhone13256GBGreen.png";
import ip14128GBMidnight from "../../image/products/iPhone14128GBMidnight.png";
import ip14256GBYellow from "../../image/products/iPhone14256GBYellow.png";
import iPSE64GB2022Midnight from "../../image/products/iPhoneSE64GB2022Midnight.png";
import iphone_11_red from "../../image/products/iphone_11_red.png";

export default function App() {
  return (
    <div className="container">
      <Swiper
        navigation={true}
        slidesPerView={4}
        spaceBetween={50}
        modules={[Navigation]}
        className="mySwiper"
      >
        <SwiperSlide>
          <div className="swiper__conteiner_img">
            <img src={iphone_11_red} alt="" />
          </div>
          <div>
            <span>Apple iPhone 13 mini 256GB (PRODUCT) Red</span>
            <button></button>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="swiper__conteiner_img">
            <img src={ip14128GBMidnight} alt="" />{" "}
          </div>
          <div>
            <span>Apple iPhone 14 128GB Midnight</span>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="swiper__conteiner_img">
            <img src={iPSE64GB2022Midnight} alt="" />{" "}
          </div>
          <div>
            <span>Apple iPhone SE 64GB 2022 Midnight</span>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="swiper__conteiner_img">
            <img src={ip13256GBGreen} alt="" />{" "}
          </div>
          <div>
            <span>Apple iPhone 13 256GB Green</span>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="swiper__conteiner_img">
            <img src={iP14ProMax1TBSilver} alt="" />{" "}
          </div>
          <div>
            <span>Apple iPhone 14 Pro Max 1TB Silver </span>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="swiper__conteiner_img">
            <img src={ip14256GBYellow} alt="" />{" "}
          </div>
          <div>
            <span>Apple iPhone 14 256GB Yellow</span>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="swiper__conteiner_img">
            <img src={iphone_11_red} alt="" />{" "}
          </div>
          <div>
            <span>Huawei Mate 50 Pro 8/256GB Black</span>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="swiper__conteiner_img">
            <img src={iphone_11_red} alt="" />{" "}
          </div>
          <div>
            <span>Huawei Mate 50 Pro 8/256GB Black</span>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="swiper__conteiner_img">
            <img src={iphone_11_red} alt="" />{" "}
          </div>
          <div>
            <span>Huawei Mate 50 Pro 8/256GB Black</span>
          </div>
        </SwiperSlide>
      </Swiper>
    </div>
  );
}
